import Navbar from "react-bootstrap/Navbar";
import { Nav } from "react-bootstrap";

function BarraScorrevole() {
  return (
    <>
      <hr className="light" />
      <div>
        <h1>GRAFIC DESIGNER • FRONT-END DEVELOPER • 3D MODEL CONTENT •</h1>
      </div>
      <hr className="light" />
    </>
  );
}

export default BarraScorrevole;
